package ac.drsi.nestor.entity;

public class SVDS_InfoData {
	//mark,name,value
	private String mark;//基本信息标记
	private String name;//基本信息名称
	private String value;//基本信息值
	public String getMark() {
		return mark;
	}
	public void setMark(String mark) {
		this.mark = mark;
	}
	public String getName() {
		return name;
	}
	public void setName(String name) {
		this.name = name;
	}
	public String getValue() {
		return value;
	}
	public void setValue(String value) {
		this.value = value;
	}
	public SVDS_InfoData() {
		super();
		// TODO Auto-generated constructor stub
	}
	public SVDS_InfoData(String mark, String name, String value) {
		super();
		this.mark = mark;
		this.name = name;
		this.value = value;
	}
	
	
}
